(6825, 'mst_hsk_sublession_theory', 'update', '267 # type3 # <div>Components of Pinyin</div> # <div>Pinyin is composed of three parts:</div><div>1) Initial,&nbsp;<span style=\"font-size: 0.88rem;\">2) Final and&nbsp;</span><span style=\"font-size: 0.88rem;\">3) Tone</span></div><div>The initials and finals are similar to the letters in English.<br></div> # <div>In Pinyin, you need to focus on the pronunciations of each letter in the Chinese system.<br></div> # VMynv.png # 4 # NULL # 2020-07-29 # 2020-07-29 12:46:44 # 1 # ', '267 # type3 # <div>Components of Pinyin</div> # <div><div>Pinyin is composed of three parts:</div><div>1) Initial,</div><div>2) Final,</div><div>3) Tone</div><div><br></div><div>The initials and finals are similar to the English letters.</div></div> # <div>In Pinyin, your focus will be on the pronunciations of each letter in the Chinese system.<br></div> # VMynv.png # 4 # null # 2020-07-29 # 2020-07-29 12:46:44 # 1 # ', 39, '2020-08-07 06:10:05'),
